@laundered11 @LoblawsON @sobeys So you didnt do whatever it took? 

Not sure what you are trying to say, and so sorry you lost your mother. 

Half my Dads side is military. Lieutenants, Sergeants, Great Grandfather served in both wars, cousins currently serving. We are not China. I understand you are grieving.

@realDailyWire No. Prior to the China virus, we voted IN PERSON and the results were available an hour after the polls closed. 

Absentee ballots were notarized for people in the military, desperately ill, or traveling outside the country on election DAY.  

Mail-in-ballots must be abolished.
